import { defer } from "react-router-dom";
import { Aboutme, Aboutmecontent, TitleBottom, TitleTob } from "./About";
import { H3, H4 } from "./Home";
import styled from "styled-components";

const AcEducation = styled(Aboutme)`
    /* background-color: dodgerblue; */
`
const EducationContent = styled(Aboutmecontent)`
    background-color: yellow;
`
const EducationTitleTob = styled(TitleTob)`
    justify-content: space-between;
`
const EducationTitleBottom = styled(TitleBottom)`

`
const EducationImg = styled.div`
    width: 100%;
    max-width: 1196px;
    height: 650px;
    background-color: yellowgreen;
`

const TitleTobcontent = styled.div`
    height: 100%;
    /* background-color: yellow; */
    display: flex;
    align-items: center;
    justify-content: end;
    gap: 1rem;
    padding-right: 12px;
`
function Education(){
    return(
        <>
            <AcEducation>
                <EducationTitleTob>
                    <H3>Education &gt;</H3>
                    <TitleTobcontent>
                        <H4>수료증</H4>
                        <H4>이수증</H4>
                        <H4>표창장</H4>
                    </TitleTobcontent>
                </EducationTitleTob>
                <EducationContent>
                    
                </EducationContent>
                <EducationTitleBottom><H3> &lt; Education</H3></EducationTitleBottom>
            </AcEducation>
        </>
    )
}

export default Education
